import Carrot from './carrots.jpg';

function MangeItem() {
    return(
        <div className="manage-container">
            <div className="manage-item">
                <img src={Carrot} />
                <div>
                    <div>
                        <input placeholder='Carrot' type='text'/>
                        <input placeholder='Rs. 650 / 1kg' type='text'/>
                    </div>
                    <div>

                    </div>
                </div>
                <div></div>
            </div>
        </div>
    )
}

export default MangeItem;
